"use strict";

var d20 = {

	roll: function(dice, verbose) {
		var result = d20.verboseRoll(dice),
			num = 0;

        if(verbose) {
            return result;
        } else {
            for (var i in result) {
                num += result[i];
            }

            return num;
        }
	},

	verboseRoll: function(dice) {
		var amount = 1,
			mod = 0,
			results = [],
			match,
			num,
			modifiers;

		if (!dice) {
			throw new Error('Missing dice parameter.');
		}

		if (typeof dice == 'string') {
			match = dice.match(/^\s*(\d+)?\s*d\s*(\d+)\s*(.*?)\s*$/);
			if (match) {
				if (match[1]) {
					amount = parseInt(match[1]);
				}
				if (match[2]) {
					dice = parseInt(match[2]);
				}
				if (match[3]) {
					modifiers = match[3].match(/([+-]\s*\d+)/g);
					for (var i = 0; i < modifiers.length; i++) {
						mod += parseInt(modifiers[i].replace(/\s/g, ''));
					}
				}
			} else {
				parseInt(dice);
			}
		}

		if (isNaN(dice)) {
			return [];
		}

		for (var i = 0; i < amount; i++) {
			if(dice !== 0){
				num = Math.floor(Math.random() * dice + 1);
			}else{
				num = 0;
			}
			results.push(num);
		}

		results = results.sort(function(a, b) {
			return a - b;
		});
		if (mod != 0) {
			results.push(mod);
		}

		return results;
	}
};

